// File: src/pages/WeddingAlbumPage.jsx
import { useMemo, useState } from "react";

const BG_URL =
  "https://cyxeucwesqzwlisgveiz.supabase.co/storage/v1/object/public/public-assets/flowers-8309997.jpg";

// Clean up env values (remove quotes and trailing comments)
const fromEnv = (v) =>
  v ? String(v).split("#")[0].replace(/^["']|["']$/g, "").trim() : "";

const PHOTOS_FOLDER = fromEnv(process.env.REACT_APP_DRIVE_PHOTOS_FOLDER_ID);
const VIDEOS_FOLDER = fromEnv(process.env.REACT_APP_DRIVE_VIDEOS_FOLDER_ID);

export default function WeddingAlbumPage() {
  const [tab, setTab] = useState("photos");

  const photosSrc = useMemo(
    () =>
      PHOTOS_FOLDER
        ? `https://drive.google.com/embeddedfolderview?id=${PHOTOS_FOLDER}#grid`
        : "",
    []
  );
  const videosSrc = useMemo(
    () =>
      VIDEOS_FOLDER
        ? `https://drive.google.com/embeddedfolderview?id=${VIDEOS_FOLDER}#grid`
        : "",
    []
  );

  return (
    <Backdrop>
      <Card>
        <header className="mb-6">
          <h1 className="section-title">Wedding Album</h1>
          <p className="text-soil-700">
            Live folder view from Google Drive. New uploads appear automatically once Drive finishes processing.
          </p>
        </header>

        {/* Tabs */}
        <div className="flex gap-2 mb-4">
          <button
            className={`btn-outline ${tab === "photos" ? "bg-white/80" : ""}`}
            onClick={() => setTab("photos")}
          >
            Photos
          </button>
          <button
            className={`btn-outline ${tab === "videos" ? "bg-white/80" : ""}`}
            onClick={() => setTab("videos")}
          >
            Videos
          </button>
        </div>

        {/* Warnings if env is missing */}
        {(!PHOTOS_FOLDER || !VIDEOS_FOLDER) && (
          <div className="text-sm text-amber-700 bg-amber-50 border border-amber-200 rounded-md p-2 mb-4">
            Missing Drive folder IDs. Set <code>REACT_APP_DRIVE_PHOTOS_FOLDER_ID</code> and
            <code> REACT_APP_DRIVE_VIDEOS_FOLDER_ID</code> in your <code>.env</code>, then restart the dev server.
          </div>
        )}

        {/* Instructions if folders aren't shared properly */}
        <div className="text-xs text-soil-600 mb-4">
          If the frames are blank, in Google Drive set each folder’s “General access” to{" "}
          <span className="font-medium">Anyone with the link → Viewer</span>.
        </div>

        {/* Iframe container */}
        <div className="rounded-2xl overflow-hidden border border-white/60 bg-white/70">
          {tab === "photos" ? (
            <DriveFrame src={photosSrc} fallbackId={PHOTOS_FOLDER} label="Photos" />
          ) : (
            <DriveFrame src={videosSrc} fallbackId={VIDEOS_FOLDER} label="Videos" />
          )}
        </div>
      </Card>
    </Backdrop>
  );
}

function DriveFrame({ src, fallbackId, label }) {
  if (!src) {
    return (
      <div className="p-6 text-soil-700">
        {label} folder not configured.
      </div>
    );
  }
  const openUrl = `https://drive.google.com/drive/folders/${fallbackId}?usp=sharing`;
  return (
    <div className="w-full">
      {/* The embedded folder view renders a built-in grid with thumbnails */}
      <iframe
        title={`Google Drive ${label}`}
        src={src}
        className="w-full"
        style={{ minHeight: 700, border: 0 }}
      />
      <div className="flex justify-end p-2">
        <a href={openUrl} target="_blank" rel="noreferrer" className="btn-outline">
          Open {label} in Drive ↗
        </a>
      </div>
    </div>
  );
}

/** UI wrappers */
function Backdrop({ children }) {
  return (
    <div
      className="min-h-screen w-full bg-center bg-cover relative"
      style={{ backgroundImage: `url(${BG_URL})` }}
    >
      <div className="absolute inset-0 bg-black/30 backdrop-blur-[1px]" />
      <div className="relative z-10 max-w-6xl mx-auto px-4 py-10">{children}</div>
    </div>
  );
}

function Card({ children, className = "" }) {
  return (
    <div
      className={`bg-white/85 rounded-2xl shadow-xl border border-white/60 p-6 md:p-8 ${className}`}
    >
      {children}
    </div>
  );
}
